import React from 'react';
import WorkHereModal from './AuthenticationModal';
import { connect } from 'react-redux';
import * as actions from '../Redux/Actions/actions';

class NavigationBar extends React.PureComponent {
  render() {
    if (this.props.employeeToken === '') {
      return (
        <nav className="navigationBar">
          <ul>
            <li>
              <button>Our services</button>
            </li>
            <li>
              <button>Our staff</button>
            </li>
            <li>
              <button>Feedback</button>
            </li>
            <li>
              <button>Reviews</button>
            </li>
            <li>
              <button>About us</button>
            </li>
            <li>{/* <WorkHereModal /> */}</li>
            <li>
              <button className="booking">Book now</button>
            </li>
          </ul>
        </nav>
      );
    } else {
      return (
        <div className="sideBar">
          <button
            className="sideBarItem"
            id="stuffPage"
            onClick={() => {
              this.props.getStaff();
            }}
          >
            Stuff
          </button>
          <button
            className="sideBarItem"
            id="clientsPage"
            onClick={() => {
              this.props.getClients();
            }}
          >
            Clients
          </button>
          <button
            className="sideBarItem"
            id="servicesPage"
            onClick={() => {
              this.props.getServices();
            }}
          >
            Services
          </button>
          <button
            className="sideBarItem"
            id="materialsPage"
            onClick={() => {
              this.props.getMaterials();
            }}
          >
            Materials
          </button>
          <button
            className="sideBarItem"
            id="ordersPage"
            onClick={() => {
              this.props.getOrders();
            }}
          >
            Orders
          </button>
          <button
            className="sideBarItem"
            id="schedulesPage"
            onClick={() => {
              this.props.getSchedules();
            }}
          >
            Schedules
          </button>
          <button
            className="sideBarItem"
            id="promoPage"
            onClick={() => {
              this.props.getPromos();
            }}
          >
            Promo
          </button>
          <button
            className="sideBarItem"
            id="profilesPage"
            onClick={() => {
              this.props.getProfiles();
            }}
          >
            Profiles
          </button>
          <button
            className="sideBarItem"
            id="galleryPage"
            onClick={() => {
              this.props.getgallery();
            }}
          >
            Gallery
          </button>
          <button
            className="sideBarItem"
            id="feedbacksPage"
            onClick={() => {
              this.props.getFeedbacks();
            }}
          >
            Feedbacks
          </button>
          <button
            className="sideBarItem"
            id="filePage"
            onClick={() => {
              this.props.getFiles();
            }}
          >
            MediaFiles
          </button>
        </div>
      );
    }
  }
}

function mapStateToProps(state) {
  return {
    employeeToken: state.employeeToken,
  };
}

function mapDispatchToProps(dispatch) {
  return {
    getClients: () => dispatch(actions.ClientsFeetchData()),
    getStaff: () => dispatch(actions.StaffsFeetchData()),
    getMaterials: () => dispatch(actions.MaterialsFeetchData()),
    getServices: () => dispatch(actions.ServicesFeetchData()),
    getOrders: () => dispatch(actions.OrdersFeetchData()),
    getSchedules: () => dispatch(actions.SchedulesFeetchData()),
    getPromos: () => dispatch(actions.PromosFeetchData()),
    getProfiles: () => dispatch(actions.ProfilesFeetchData()),
    getFeedbacks: () => dispatch(actions.FeedbacksFeetchData()),
    getGallery: () => dispatch(actions.MediaFilesFeetchData()),
    getFiles: () => dispatch(actions.MediaFilesFeetchData()),
  };
}

export default connect(mapStateToProps, mapDispatchToProps)(NavigationBar);
